import React from "react";


function Video(prop) {
  const videoId = getVideoIdFromUrl(prop.videoObj.url);
  return (
    <div>
      {/* Display your video content here */}
      <h5 className="videoTitle">{prop.videoObj.title}</h5>
      <iframe
        width="100%"
        height="200"
        src={`https://www.youtube.com/embed/${videoId}`}
        title="YouTube video player"
      ></iframe>
      <p>Res</p>
      <div className="btnCounter">


        <button type="button" className="btn btn-success"><i class="fa-solid fa-thumbs-up"></i> </button>
        <p>{prop.videoObj.rating} </p>
        <button type="button" className="btn btn-danger">
          -
        </button>
        <button type="button" className="btn btn-danger">
          Delete
        </button>
      </div>
    </div>
  );
}
export default Video;
function getVideoIdFromUrl(url) {
  const videoId = url.split("v=")[1];
  return videoId;
}
